import React from 'react';
import HEAD from './CODE/HEAD/HEAD.js'
import CONTENT from './CODE/CONTENT/CONTENT.js'
import FOOTER from './CODE/FOOTER/FOOTER'
import s from './App.module.css'

import { BrowserRouter } from 'react-router-dom';


function App(props) {

  return (
    <BrowserRouter>
      <div className={s.wrapper}>
        <HEAD />
        <CONTENT data={props.data} addData_bag={props.addData_bag} ubdateTodayTextarea={props.ubdateTodayTextarea}/>
        <FOOTER />
      </div>
    </BrowserRouter>
  );
}

export default App;
